template <typename UnionPtrType> DataElementPtr DataElement::Clone() const
{
    switch (tag_) {
    case Tag::kBytes:
        return NewBytes(mojo::Clone(*data_.bytes));
    case Tag::kFile:
        return NewFile(mojo::Clone(*data_.file));
    case Tag::kDataPipe:
        return NewDataPipe(mojo::Clone(*data_.data_pipe));
    case Tag::kChunkedDataPipe:
        return NewChunkedDataPipe(mojo::Clone(*data_.chunked_data_pipe));
    }
    return nullptr;
}

template <typename T, typename std::enable_if<std::is_same<T, DataElement>::value>::type*> bool DataElement::Equals(const T& other) const
{
    if (tag_ != other.which())
        return false;

    switch (tag_) {
    case Tag::kBytes:
        return mojo::Equals(*(data_.bytes), *(other.data_.bytes));
    case Tag::kFile:
        return mojo::Equals(*(data_.file), *(other.data_.file));
    case Tag::kDataPipe:
        return mojo::Equals(*(data_.data_pipe), *(other.data_.data_pipe));
    case Tag::kChunkedDataPipe:
        return mojo::Equals(*(data_.chunked_data_pipe), *(other.data_.chunked_data_pipe));
    }

    return false;
}
